輪花鉢 / 森岡由利子（和歌山）
.
現在開催中の森岡由利子展より、輪花鉢をご紹介いたします。
薪窯で焼成され、見込みの灰が被った跡や砂高台が味わい深い作品。
高台が高い器は祝いごとなどに使うイメージがありますが、深さのある程よい大きさの鉢は使い勝手がよく、森岡家では日々の食卓でよく登場するそうです。
主張がなく料理を引き立ててくれ、控えめながらも少しだけ食卓に華を添えてくれる、そんな気の利く器です。
.
なお、現在の新型コロナウイルス感染拡大に伴い、予防対策を行いながら営業しております。
ご入店時にはマスクの着用と、手のアルコール消毒をお願いさせて頂きます。店内は常時換気を行ない、店頭スタッフもマスクを着用させて頂きます。また、ご来場のお客様が複数人 重なりましたら、入場制限をさせて頂きますので、ご了承くださいませ。
.
